import React from "react";
import Pokemon from "../../pages/Pokemon";

const PokemonItem = (props) => {
  return (
    <div>
      {props.items.map((p, i) => {
        return <div key={i}>{p.name}</div>;
      })}
    </div>
  );
};
export default PokemonItem;
